import React, { Component } from "react";
import { faUserCircle } from "@fortawesome/free-regular-svg-icons";
import { faSignInAlt } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import '../pages/Main.css'

class Music extends Component {
  constructor(props) {
    console.log("[Header.js] Constructor");
    super(props);
    this.handleLogout = this.handleLogout.bind(this);
  }

  handleLogout(event) {
    console.log("[Header.js] handleLogout");
    // event.preventDefault();
    localStorage.setItem("token", null);
    localStorage.setItem("username", null);
    console.log("[Header.js] Call doLogout");
    this.props.doLogout();
  }

  render() {
    // console.log("[*] Header Component");
    // console.log("isLogin: ", this.props.isLogin);

    return (
      
          <div className='div'>
            
            <div className='div3'>음악 올리기</div>
            <b className='mp3Wav'>mp3 파일 대신 wav 파일을 올려주세요.</b>
            <div className='rectangleDiv1' />
            <div className='rectangleDiv2' />
            <img className='rectangleIcon1' alt="" src="../rectangle-15.svg" />
            <img className='vectorIcon' alt="" src="../vector-10.svg" />
            <div className='div4'>음악 제목을 입력해주세요.</div>
            <div className='wav'>파일이름.wav</div>
            <div className='div5'>확인</div>
          </div>
        );
      };
      
    
    
  }


export default Music;
